package Tools

import (
	"chaincodes/Assets/Structs"
	"encoding/json"
	"fmt"
)

func CreateAsset(cdasCryptoJSON string) []Structs.AssetIdentidad {
	var cdasCrypto []Structs.CDAcrypto
	err := json.Unmarshal([]byte(cdasCryptoJSON), &cdasCrypto)
	if err != nil {
		fmt.Println(err)
	}
	var assets []Structs.AssetIdentidad
	for _, cda_ := range cdasCrypto {
		asset := Structs.AssetIdentidad{
			ID:   cda_.CDA.IdDevice,
			CDA:  cda_.CDA.Provincia + cda_.CDA.Canton + cda_.CDA.Parroquia + cda_.CDA.Recinto,
			Cert: string(cda_.CERT),
		}
		assets = append(assets, asset)
	}
	return assets

}

